    false,nt"url": null,nt"notes": "The objectives of the Ohio River Islands
    National Wildlife Refuge clearly state that appropriate public uses, including hunting,
    should be encouraged and that compatible public use programs should be developed
    for the refuge. The Fish and Wildlife Service has long considered hunting an acceptable
    and desirable form of wildlife-oriented recreation. Hunting is also considered a
    valuable management tool. Through hunting, the refuge can make productive use of
    harvestable wildlife surpluses while effectively controlling population levels,
    specifically withregard to white-tailed deer. This plan relates the goals of hunting
    to the overall objectives of the refuge",nt"license_title": "License Not Specified",nt"extras":
